import { getAllUsersAdmin } from '../store/actions/postAction'
import { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'

function Admin({user, auth}) {

    const dispatch = useDispatch()
    const {allusers}  = useSelector(state => state.post)
    console.log(user)
    console.log(auth)
    useEffect(() => {
        dispatch(getAllUsersAdmin(auth.accessToken, 50))
    }, [])

    return  (
        <div className='admin'>
            <h1>All Users</h1>
            <div className='labels'>
                <h3>First Name</h3>
                <h3>Last Name</h3>
                <h3>Email</h3>
                <h3>Password</h3>
            </div>
            <div className='allUsers'>
                {allusers && allusers.map((user, i) => {
                    return (
                        <div className='singleUser'>
                            <h2>{user.firstName}</h2>
                            <h2>{user.lastName}</h2>
                            <h2>{user.email}</h2>
                            <h2>{user.password}</h2>
                        </div>
                    )
                })}
            </div>
            <style jsx>{`
                .labels {
                    float: left;
                    width: 100%;
                }
                .labels h3 {
                    margin: 10px 0;
                    font: 18px 'Montserrat';
                    width: 25%;
                    text-align: center;
                }
                .allUsers {
                    float: left;
                    width: 90%;
                    margin: 10px 5%;
                    display: flex;
                    flex-flow: column wrap;
                    justify-content: center;
                }
                .singleUser {
                    float: left;
                    width: 100%;
                    display: flex;
                    flex-flow: column no-wrap;
                    justify-content: flex-start;
                }
                .singleUser h2 {
                    padding: 10px;
                    margin: 0;
                    font: 14px 'Roboto';
                    min-width: 15%;
                    max-width: 25%;
                    max-width: 50%;
                    overflow: hidden;
                }
                h1 {
                    float: left;
                    padding: 10px;
                    margin: 20px;
                    font: 32px 'Montserrat';
                }
                .admin {
                    float: left;
                    margin: 60px 0;
                    width: 100%;
                    height: 100%;
                }
            `}</style>
        </div>
    )
}

export default Admin
